      Password : "password",
      To : 'them@website.com',
      From : "you@isp.com",
      Subject : "This is the subject",
      Body : "And this is the body"
    }).then(
    message => alert(message)
    );
    
    
  return (
    <div>email</div>
  )
}

export default email
